import assert from "assert";
import { execSync } from "child_process";
import { existsSync, readFileSync } from "fs";
import path from "path";

function readJson(filePath) {
	return JSON.parse(readFileSync(filePath, "utf8"));
}

const listResult = execSync(
	"pnpm --filter=!wrangler-root list --recursive --depth -1 --parseable"
);
const paths = listResult.toString().trim().split("\n");
for (const p of paths) {
	if (!path.isAbsolute(p)) continue;

	const pkg = readJson(path.join(p, "package.json"));

	// Ensure all packages with a build script have a turbo build output configured
	if (pkg.scripts?.build) {
		console.log(pkg.name, "has build script. Checking turbo.json");
		let turboConfig;
		try {
			turboConfig = readJson(path.join(p, "turbo.json"));
		} catch {
			console.log("Failed to read turbo.json for", pkg.name);
			process.exit(1);
		}
		const buildOutputs = turboConfig.tasks.build.outputs;
		assert(buildOutputs.length > 0);
	}

	// Ensure all packages with a vitest config file have a "test:ci" script
	if (
		existsSync(path.join(p, "vitest.config.ts")) ||
		existsSync(path.join(p, "vitest.config.mts"))
	) {
		assert(
			pkg.scripts["test:ci"],
			`Package "${p}" is missing a "test:ci" script in package.json`
		);
	}
}

// https://github.com/cloudflare/workers-sdk/pull/2496#discussion_r1062516883

import { WebAssembly as WorkerWebAssembly } from "@cloudflare/workers-types";
import type {
	EventTargetAddEventListenerOptions,
	EventTargetEventListenerOptions,
} from "@cloudflare/workers-types";

declare global {
	type EventListenerOptions = EventTargetEventListenerOptions;
	type AddEventListenerOptions = EventTargetAddEventListenerOptions;
	// (can't use EventTarget from "@cloudflare/workers-types" as it's event map
	// type parameters are incompatible with `tinybench`, a `vitest` dependency)

	// `WebAssembly` has been global since Node 8, but isn't included in
	// `@types/node`.
	type BufferSource = ArrayBufferView | ArrayBuffer;
	namespace WebAssembly {
		class CompileError extends WorkerWebAssembly.CompileError {}
		class RuntimeError extends WorkerWebAssembly.RuntimeError {}

		type ValueType = WorkerWebAssembly.ValueType;
		type GlobalDescriptor = WorkerWebAssembly.GlobalDescriptor;
		class Global extends WorkerWebAssembly.Global {}

		type ImportValue = WorkerWebAssembly.ImportValue;
		type ModuleImports = WorkerWebAssembly.ModuleImports;
		type Imports = WorkerWebAssembly.Imports;

		type ExportValue = WorkerWebAssembly.ExportValue;
		type Exports = WorkerWebAssembly.Exports;

		class Instance extends WorkerWebAssembly.Instance {}

		type MemoryDescriptor = WorkerWebAssembly.MemoryDescriptor;
		class Memory extends WorkerWebAssembly.Memory {}

		type ImportExportKind = WorkerWebAssembly.ImportExportKind;
		type ModuleExportDescriptor = WorkerWebAssembly.ModuleExportDescriptor;
		type ModuleImportDescriptor = WorkerWebAssembly.ModuleImportDescriptor;
		class Module extends WorkerWebAssembly.Module {
			// Node.js allows dynamic compilation of WebAssembly unlike Workers
			constructor(bytes: BufferSource);
		}

		type TableKind = WorkerWebAssembly.TableKind;
		type TableDescriptor = WorkerWebAssembly.TableDescriptor;
		class Table extends WorkerWebAssembly.Table {}

		// Node.js allows dynamic compilation of WebAssembly unlike Workers
		interface WebAssemblyInstantiatedSource {
			instance: Instance;
			module: Module;
		}
		function compile(bytes: BufferSource): Promise<Module>;
		function instantiate(
			bytes: BufferSource,
			importObject?: Imports
		): Promise<WebAssemblyInstantiatedSource>;
		function instantiate(
			moduleObject: Module,
			importObject?: Imports
		): Promise<Instance>;
		function validate(bytes: BufferSource): boolean;
	}

	// `Worker` isn't defined on the global scope in Node.js, but it's required
	// by `vite`. Therefore, define it as an empty interface.
	// eslint-disable-next-line @typescript-eslint/no-empty-interface
	interface Worker {}

	// `MessagePort` has been global since Node 15, but isn't included in
	// `@types/node`. This is required by `undici`'s types.
	// eslint-disable-next-line no-var,@typescript-eslint/consistent-type-imports
	var MessagePort: typeof import("worker_threads").MessagePort;
}

{
	"$schema": "http://turbo.build/schema.json",
	"remoteCache": {
		"signature": true
	},
	"globalEnv": ["CI_OS", "NODE_VERSION", "VITEST"],
	"tasks": {
		"dev": {
			"persistent": true,
			"cache": false
		},
		"build": {
			"dependsOn": ["^build"]
		},
		"test": {
			"dependsOn": ["build"]
		},
		"test:watch": {
			"persistent": true,
			"cache": false
		},
		"topological": {
			"dependsOn": ["^topological"]
		},
		"check:lint": {
			"dependsOn": ["topological"]
		},
		"check:type": {
			"dependsOn": ["topological"]
		},
		"type:tests": {
			"dependsOn": ["topological"]
		},
		"test:ci": {
			"dependsOn": ["build"]
		},
		"test:e2e": {},
		"//#check:format": {
			"cache": true
		}
	}
}

import { defineConfig } from "vitest/config";

// This default gets pulled in by all the Vitest runs in the monorepo.
export default defineConfig({
	test: {
		// These timeouts are very large because the Windows CI jobs regularly take up ot 42 secs.
		// Ideally we should not have such high defaults across all tests, but instead be able to
		// increase timeouts for certain sets of tests.
		// But this might need some vitest/turborepo magical incantations and bumping the values
		// here is a simpler short term fix.
		// Note that this will not cause tests to pass that should fail. It just means that hanging
		// tests will take longer to fail than they would before.
		testTimeout: 50_000,
		hookTimeout: 50_000,
		teardownTimeout: 50_000,
		poolOptions: {
			useAtomics: true,
		},
		restoreMocks: true,
		// A lot of the fixture tests are extremely flaky because of the dev registry
		// Retry tests by default so that only real errors are reported
		retry: 2,
	},
});

export default [
	"packages/*/vitest.config.mts",
	"fixtures/*/vitest.config.mts",
	"tools/vitest.config.mts",
];
